■お取り寄せの為、ご注文を頂いた時点で完売となっている可能性がございます。 その場合はご連絡させて頂きますので予めご了承ください<table width="600" border="0" align="center" cellpadding="0" cellspacing="0"><tr><td><font color="#009999" size="5"><strong>植物由来のL型乳酸だから体に優しく溶けやすい。</strong></font></td></tr></table><br><table width="610" border="0" align="center" cellpadding="1" cellspacing="0"> <tr> <td width="610" valign="top" align="center"><div ><img src="http://image.rakuten.co.jp/tuhan-ya/cabinet/t_simple0383/7626ar-01.jpg" width="591" height="689"></div><br><table width="600" border="0" align="center" cellpadding="5" cellspacing="1" bgcolor="#999999"><tr><td bgcolor="#FFFFCC"><table width="100%" border="0" cellpadding="3" cellspacing="0"><tr><th><font color="#FF0000">------ ココがポイント！ ------</font></th></tr><tr><td><strong><font size="3" color="#FF9900">●毎日の炊飯に!</font></strong></td></tr></table></td></tr></table><br><table width="600" border="0" align="center" cellpadding="1" cellspacing="0"> <tr> <td width="600" valign="top" align="left"><font size="3">■製造元■<br>株式会社　スカイフード<br>〒555-0024　大阪市西淀川区野里1丁目10番8号<br><br><br>使用目安：炊飯時お米2合に2g(添付スプーン2杯)を入れます。<br>※添付スプーン1杯(1g)・・・カルシウム130mg</font></td></tr></table><br><br><table width="600" border="0" align="center" cellpadding="1" cellspacing="0"> <tr> <td width="600" valign="top" align="left"><br><font size="3">野菜の糖質を乳酸菌で発酵させて作ったL型乳酸にライム(甲殻類や貝類の化石が風化したもの)を加えて作られたL型乳酸カルシウムは、イオン化しやすく体内吸収性が高いカルシウムです。</font></td></tr></table></td></tr></table><br><!--栄養成分・原材料表ここから--><table width="600" border="0" align="center" cellpadding="5" cellspacing="1" bgcolor="#666666"><tr bgcolor="#FFFFFF">    <td width="25%" bgcolor="#FFFFCC"><font color="#333333" size="-1">栄養成分</font></td>    <td width="75%"><font color="#333333" size="-1">(100gあたり)エネルギー：185Kcal、たんぱく質：0g、脂質：0g、炭水化物：61.6g、ナトリウム：0mg、カルシウム：13300mg</font></td></tr><tr bgcolor="#FFFFFF">    <td width="25%" bgcolor="#FFFFCC"><font color="#333333" size="-1">原材料</font></td>    <td width="75%"><font color="#333333" size="-1">乳酸カルシウム</font></td></tr></table><br><!--栄養成分・原材料表ここまで--><!--ab--><!--ab2015.6-->■お取り寄せの為、ご注文を頂いた時点で完売となっている可能性がございます。  その場合はご連絡させて頂きますので予めご了承ください<br><table width="300" border="0" cellspacing="0" cellpadding="0"><tr><td><font color="#333333" size="-1">野菜の糖質を乳酸菌で発酵させて作ったL型乳酸にライム(甲殻類や貝類の化石が風化したもの)を加えて作られたL型乳酸カルシウムは、イオン化しやすく体内吸収性が高いカルシウムです。</font></td></tr></table><br><table width="300" border="0" cellpadding="5" cellspacing="1" bgcolor="#666666"><tr bgcolor="#FFFFFF"><td width="25%" align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">内容量</font></td><td width="75%" align="left"><font color="#333333" size="-1">115g</font></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">サイズ</font></td><td align="left"><font color="#333333" size="-1">個装サイズ：6×6×11cm</font></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">重量</font></td><td align="left"><font color="#333333" size="-1">個装重量：165g</font></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">仕様</font></td><td align="left"><font color="#333333" size="-1">商品区分：健康食品</font><br><font color="#333333" size="-1">名称：食品添加物 カルシウム強化剤</font><br><font color="#333333" size="-1">保存方法：使用後はフタをしっかり閉めて、冷暗所で保管してください。</font><br> <font color="#333333" size="-1">賞味期間：製造日より720日</font><br></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">製造国</font></td><td align="left"><font color="#333333" size="-1">日本</font></td></tr></table><!--スペックここまで--><!--ab--><!--ab2015.6-->・広告文責(株式会社創和　0299-47-0506)<style type="text/css">
