■お取り寄せの為、ご注文を頂いた時点で完売となっている可能性がございます。 その場合はご連絡させて頂きますので予めご了承ください<p><table width="600" border="0" align="center" cellpadding="0" cellspacing="0">  <tr>  <td>  <font color="#009999" size="5"><strong>国産、天然由来のサンゴカルシウム配合。</strong></font>  </td>  </tr>  </table><br>  <table width="600" border="0" align="center" cellpadding="1" cellspacing="0">   <tr>   <td width="600" valign="top" align="center"><img src="http://image.rakuten.co.jp/tuhan-ya/cabinet/t_simple0144/9193z-01.jpg" width="600px" height="914px" ><br>  <table width="600" border="0" align="center" cellpadding="5" cellspacing="1" bgcolor="#999999">  <tr>  <td bgcolor="#FFFFCC">  <table width="100%" border="0" cellpadding="3" cellspacing="0">  <tr>  <th><font color="#FF0000">------ ココがポイント！ ------</font></th>  </tr>  <tr>  <td><strong><font size="3" color="#FF9900">●カルシウムが不足している方に</font></strong></td>  </tr>  <tr>  <td><strong><font size="3" color="#FF9900">●外食の多い方に</font></strong></td>  </tr>  </table>  </td>  </tr>  </table>  <br>  <table width="600" border="0" align="center" cellpadding="1" cellspacing="0">   <tr>   <td width="600" valign="top" align="left"><font size="3"></p><p>販売者:補完医療製薬株式会社<br>大阪市中央区谷町9-2-27-303Ａ<br><br></p><p>食品として、1日に2粒程度を目安に水などでお召し上がり下さい。万一、体質に合わない場合はご利用を中止して下さい。天然由来の成分を主として使用しているため、多少色のバラツキが生じる場合がございますが、品質には全く問題ありません。<br>  <br>  【原材料】<br>  サンゴカルシウム、結晶セルロース、アラビアゴム末、微粒二酸化ケイ素、ステアリン酸Ca、ビタミンD3<br>  <br>  【栄養成分表示】(2粒800mgあたり)<br>  エネルギー0.53kcal<br>  たんぱく質0.002g<br>  脂質0.006g<br>  炭水化物0.11g<br>  ナトリウム0.76mg<br>  沖縄珊瑚カルシウム675mg(カルシウムとして202.5mg)<br>  マグネシウム10.1mg<br>  ビタミンD0.01μg</font>  </td>  </tr>  </table>  <br><br><table width="600" border="0" align="center" cellpadding="1" cellspacing="0">   <tr>   <td width="600" valign="top" align="left">  <br>  <font size="3">サンゴは海で育ち、海水は胎児が育つ羊水とほぼ同じ成分です。海水で育つサンゴには、人の健康に必要なミネラルがバランスよく含まれています。人が毎日必要とするミネラルはごく微量です。しかしながら、カルシウムは体内に吸収されにくく、ミネラルは体内で作り出すことは出来ません。特に日本人はカルシウムが不足しがちですので、積極的な摂取が必要とされています。本品は、サンゴカルシウムに加え、カルシウムの吸収を良くするビタミンDを配合しています。</font>  </td>  </tr>  </table>  </td>  </tr>  </table>    </p><!--ab--><!--ab2015.6-->■お取り寄せの為、ご注文を頂いた時点で完売となっている可能性がございます。  その場合はご連絡させて頂きますので予めご了承ください<br><table width="300" border="0" cellspacing="0" cellpadding="0"><tr><td><font color="#333333" size="-1">サンゴは海で育ち、海水は胎児が育つ羊水とほぼ同じ成分です。海水で育つサンゴには、人の健康に必要なミネラルがバランスよく含まれています。人が毎日必要とするミネラルはごく微量です。しかしながら、カルシウムは体内に吸収されにくく、ミネラルは体内で作り出すことは出来ません。特に日本人はカルシウムが不足しがちですので、積極的な摂取が必要とされています。本品は、サンゴカルシウムに加え、カルシウムの吸収を良くするビタミンDを配合しています。</font></td></tr></table><br><table width="300" border="0" cellpadding="5" cellspacing="1" bgcolor="#666666"><tr bgcolor="#FFFFFF"><td width="25%" align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">内容量</font></td><td width="75%" align="left"><font color="#333333" size="-1">144g(400mg×360粒)</font></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">サイズ</font></td><td align="left"><font color="#333333" size="-1">個装サイズ：12×3.5×21cm</font></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">重量</font></td><td align="left"><font color="#333333" size="-1">約151g</font><br><font color="#333333" size="-1">個装重量：220g</font></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">仕様</font></td><td align="left"><font color="#333333" size="-1">区分：健康食品</font><br><font color="#333333" size="-1">名称：サンゴカルシウム含有食品</font><br><font color="#333333" size="-1">保存方法：直射日光、高温多湿を避けて保存して下さい。</font><br><font color="#333333" size="-1">賞味期限:製造日より720日</font><br></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">製造国</font></td><td align="left"><font color="#333333" size="-1">日本</font></td></tr></table><!--ab--><!--ab2015.6-->・広告文責(株式会社創和　0299-47-0506)<style type="text/css">
