ont color="#333333" size="-1">付属品</font></td><br /><td width="75%" align="left"><font color="#333333" size="-1">スプーン</font></td><br /></tr> <br /><tr bgcolor="#FFFFFF"><br /><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">製造国</font></td><br /><td align="left"><font color="#333333" size="-1">日本</font></td><br /></tr><br /></table><!--ab--><!--ab2015.6-->・広告文責(株式会社創和　0299-47-0506)<style type="text/css">
